import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';
import { fetchActivities, signUp, signIn, createActivity, fetchRoutinesByUser, editActivity, fetchRoutineActivities, fetchRoutines, createRoutine, editRoutine } from './api';

const App = () => {
  signUp()
  signIn()
  fetchActivities()
  createActivity()
  fetchRoutinesByUser()
  editActivity()
  fetchRoutineActivities()
  fetchRoutines()
  createRoutine()
  editRoutine()
  return (
    <div id="App">
      <h1>Hello, World</h1>
    </div>
  );
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
